import axios from 'axios';

const URL = "http://localhost:3000";

export function postCsv(csv) {
  return axios.post(`${URL}/csv_file`, csv).then(response => response)
    .catch((error) => error);
}

export function getImages(batch_id, page = 1, grayscale) {

	const url = `${URL}/pictures/${batch_id}/${page}?`
	return axios.get(url).then(response => response)
    .catch((error) => error);
}
